Dil Kabbadi is a marital comedy and to quote Irrfan Khan &quot;It is Kabbadi that one's heart plays&quot;. The film delves into the lives of two couples who are caught in the web of post marital boredom. How the couples deal with an irresistible temptation of lurking out of the relationship for some fun is what the film explores. All in all Dil Kabaddi is a humorous take on urban relationships.The film stars Irrfan Khan, Rahul Bose, Konkona Sen Sharma, Soha Ali Khan, Rahul Khanna and Payal Rohatagi in lead roles and is directed by debutant director Anil Sharma.

